import React from 'react';

function TopBanner() {
 return (
  <>
   <div className="row">
    <div className="col-3">
     <img src="./logo192.png" alt="companyLogo" />
    </div>

    <div className="col">
     <h1>Joel's Movie Collection</h1>
    </div>
   </div>
  </>
 );
}

export default TopBanner;
